cy.request({
    method: "POST",
    url: apiUrl + '/users',
    headers: {
        'Content-Type': 'application/json'
    },
    body: {
        "user": {
            "username": userData.username,
            "email": userData.email,
            "password": userData.password
        }
    }
}).as('createUser');
cy.get('@createUser').then(function (response) {
    expect(response.status).to.eq(200);
    expect(response.body.user.email).to.contain(userData.user.email);
});

cy.request({
    method: "POST",
    url: apiUrl + '/users/login',
    headers: {
        'Content-Type': 'application/json'
    },
    body: {
        "user": {
            "email": userData.email,
            "password": userData.password
        }
    }
}).as('userLogin');
cy.get('@userLogin').then(function (response) {
    var userToken = response.body.user.token;
    cy.log(userToken);
    expect(response.status).to.eq(200);
    expect(response.body.user.email).to.contain(userData.email);
});

